import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { PuntoF } from 'src/app/models/PuntoF';
import { PuntoFService } from 'src/app/services/puntoFService';

@Component({
  selector: 'app-punto-fijo',
  templateUrl: './punto-fijo.component.html',
  styleUrls: ['./punto-fijo.component.css']
})
export class PuntoFijoComponent implements OnInit {
  eventForm: FormGroup;
  titulo = 'Metodo Punto Fijo';
  lista: any[] = [];
  raiz: number = 0;
  imagen: string = '';

  constructor(
    private fb: FormBuilder,
    private puntoService: PuntoFService
  ) {
    this.eventForm = this.fb.group({
      funcion: ['', Validators.required],
      funcionO:['',Validators.required],
      puntoI: ['', Validators.required],
    });
  }

  ngOnInit(): void { }

  consulta() {
    const puntoF: PuntoF = {
      funcion: this.eventForm.get('funcion')?.value,
      funcion_original:this.eventForm.get('funcionO')?.value,
      punto_inicial: this.eventForm.get('puntoI')?.value
    };

    this.puntoService.save(puntoF).subscribe(
      response => {
        console.log(response);
        const data = response.Iteraciones;
        this.raiz = response.Raiz;
        this.imagen = 'data:image/png;base64,' + response.Imagen;
        if (Array.isArray(data)) {
          this.lista = data;
          for (const iterator of this.lista) {
            console.log(iterator.iteracion);
          }
        } else {
          console.error('Los datos recibidos no son un array:', data);
        }
      },
      error => {
        console.log(error);
        this.eventForm.reset();
      }
    );
  }
}
<div class="row">
  <div class="col-sm-4">
    <div class="card">
      <div class="card-body text-center">
        <span class="titulo">{{titulo}}</span>
        <form class="mt-3" [formGroup]="eventForm" (ngSubmit)="consulta()">
          <div class="mb-3">
            <input type="text" formControlName="funcion" class="form-control form-control-lg" placeholder="Funcion Despeje">
            <div class="text-danger" *ngIf="eventForm.get('funcion')?.hasError('required') && eventForm.get('funcion')?.touched">
              <span>La funcion despeje<strong>es obligatoria</strong></span>
            </div>
          </div>
          <div class="mb-3">
            <input type="text" formControlName="funcionO" class="form-control form-control-lg" placeholder="Funcion Original">
            <div class="text-danger" *ngIf="eventForm.get('funcionO')?.hasError('required') && eventForm.get('funcionO')?.touched">
              <span>La funcion original <strong>es obligatoria</strong></span>
            </div>
          </div>
          <div class="mb-3">
            <input type="number" formControlName="puntoI" class="form-control form-control-lg" placeholder="Punto Inicial">
            <div class="text-danger" *ngIf="eventForm.get('puntoI')?.hasError('required') && eventForm.get('puntoI')?.touched">
              <span>El punto de inicio <strong>es obligatorio</strong></span>
            </div>
          </div>
          <div class="mb-3">
            <button type="button" routerLink="/**" class="btn btn-secondary btn-lg float-start">VOLVER</button>
            <button type="submit" [disabled]="eventForm.invalid" class="btn btn-success btn-lg float-end">ACEPTAR</button>
          </div>
        </form>
      </div>
    </div>
  </div>
  <div class="col-sm-8">
    <div class="card">
      <div class="card-body text-center">
        <span class="titulo">Resultados</span>
        <br>
        <span>Raiz Encontrada: {{raiz}}</span>
        <br>
        <span class="titulo">Gráfica</span>
         <br>
        <img *ngIf="imagen" [src]="imagen" alt="Gráfica">
        <table *ngIf="lista.length >= 0" class="table table-striped mt-3">
          <thead>
            <tr>
              <th scope="col">Iteracion</th>
              <th scope="col">Xi</th>
              <th scope="col">Error</th>
            </tr>
          </thead>
          <tbody>
            <tr *ngFor="let punto of lista">
              <td>{{ punto.iteracion }}</td>
              <td>{{ punto.xi }}</td>
              <td>{{ punto.error }}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  </div>
</div>
